-- 테이블 생성
CREATE TABLE memberInfo (
    `memberNumber` INT NOT NULL,
    `memberName` VARCHAR(45) NOT NULL,
    `memberGender` VARCHAR(45) NOT NULL,
    `memberBirth` DATE NOT NULL,
    `memberAddress` VARCHAR(45) NOT NULL,
    `memberCareer` TINYINT NOT NULL,
    `memberPhone` VARCHAR(13) NOT NULL,
    `memberEmail` VARCHAR(45) NOT NULL,
    `memberMajor` TINYINT NOT NULL,
    PRIMARY KEY (`memberNumber`)
);

CREATE TABLE pass (
      `memberNumber` INT NOT NULL,
      `memberPass` TINYINT NULL
);

CREATE TABLE score (
       `memberNumber` INT NOT NULL,
       `memberPaperScore` INT,
       `memberWrittenScore` INT,
       `memberInterview1Score` INT,
       `memberInterview2Score` INT,
       `memberPaperPass` TINYINT NULL,
       `memberWrittenPass` TINYINT NULL,
       `memberInterview1Pass` TINYINT NULL,
       `memberInterview2Pass` TINYINT NULL
);

CREATE TABLE admin (
       `adminNum` INT NOT NULL AUTO_INCREMENT,
       `adminId` VARCHAR(45) NOT NULL,
       `adminPassword` VARCHAR(45) NOT NULL,
       PRIMARY KEY (`adminNum`)
);

CREATE TABLE admin_log (
       `adminNum` INT NOT NULL,
       `adminLoginDate` DATE NOT NULL,
       `adminIP` VARCHAR(45) NOT NULL
);

-- auto-increment 적용
alter table memberInfo modify memberNumber int not null auto_increment;

-- foreign key 설정
alter table admin_log add foreign key(adminNum) references admin(adminNum);
alter table pass add foreign key(memberNumber) references memberInfo(memberNumber);
alter table score add foreign key(memberNumber) references memberInfo(memberNumber);

-- index 설정
create index paper_idx on score (memberPaperScore desc);
create index written_idx on score (memberPaperScore desc);
create index interview1_idx on score (memberInterview1Score desc);
create index interview2_idx on score (memberInterview2Score desc);

